import ConnectedUserMap from './util/ConnectedUserMap';
import { setTime, clearTime, setTimestamps } from './util/timestamps';
// eslint-disable-next-line @typescript-eslint/triple-slash-reference
/// <reference path="../../../graphql/graphql.d.ts" />
import { UserResolvers, makeResolvers } from './resolvers';
import { ApolloServer, CorsOptions, mergeSchemas, PubSub } from 'apollo-server';
import type winston from 'winston';
import logger, { setupLogger, Logging, LogLevels } from '../../../shared/log/logger';
import { setGenerator, generateId } from '../../../shared/idGen';
import { throwError, validateParams } from '../../../shared/errors';
import { getUser } from './util/getUser';
import { retrieveToken } from './util/retrieveToken';
import Permissions, {
  PermissionSetting,
  UserPermissionSetting,
  setPermissions
} from './util/permission';
import sendGridEmailHandler from './email/sendGridEmailHandler';
//@ts-ignore
import schema from '../../../graphql/schema.graphql';
import { InvitedUserInput } from '../../../types/resolvers-types';
import { Response } from 'express';
import { EmailManager } from './email/EmailManager';
import ContextCache from './cache/ContextCache';
import RequestStats from './util/RequestStats';
import { getRequestedFields, RequestedFields } from './util/getRequestedFields';
import getCacheKey from './util/getCacheKey';
import { leaveScrollSyncEvent, leaveConnectedDocUsersMap } from './util/leaveEvents';

export type UserAuth = {
  id: string;
  userName?: string;
};

/**
 * @ignore
 */
export type Context = {
  res: Response;
  user: UserAuth;
  permissionSetting: PermissionSetting;
  verifyPassword: VerifyPassword;
  getUserFromToken: GetUserFromToken;
  jwtCookieName: string;
  cache: ContextCache;
  resolvers: UserResolvers;
  stats: RequestStats;
  token?: string;
  connectedUsers: ConnectedUserMap;
  pubsub: PubSub;
  emailOptions: CollabServerEmailOptions;
  emailManager: EmailManager;
  requestedFields: RequestedFields;
  subscriptionFields: Record<string, RequestedFields>;
};

export type VerifyPassword = (email: string, password: string) => Promise<boolean> | boolean;
export type GetUserFromToken = (token: string) => Promise<UserAuth> | UserAuth;

/**
 * @ignore
 */
export enum Email {
  Message = 'message',
  Invite = 'invite'
}

export type InviteEmailData = {
  documentName: string;
  documentId: string;
  usersInvited: InvitedUserInput[];
  sentBy: string;
  sendTo: string[];
};

export type MessageData = {
  annotationId: string;
  messageText: string;
  documentName: string;
  documentId: string;
  sentBy: string;
  sendTo: string[];
};

export type MessageEmailData = {
  messages: Omit<MessageData, 'sendTo'>[];
  sendTo: string;
};

export type EmailFunction = (
  type: Email,
  data: InviteEmailData | MessageEmailData
) => Promise<void>;

export type CollabServerEmailOptions = {
  emailHandler?: EmailFunction;
  emailQueueTimer?: number; // timer to send emails in seconds
  emailOnAnnotationCreated?: boolean;
};

export interface ResolverObj {
  [key: string]: {
    [key: string]: (parent, args, context, info) => Promise<any>;
  };
}

export type CollabServerCustomQueriesOptions = {
  additionalTypeDefs: string;
  additionalResolvers: ResolverObj;
};
export type CollabServerOptions = {
  resolvers: UserResolvers;
  corsOption?: CorsOptions;
  idGenerator?: () => string | Promise<string>;
  logLevel?: Logging;
  logTransports?: Array<winston.transport>;
  customQueries?: CollabServerCustomQueriesOptions;
  emailOptions?: CollabServerEmailOptions;
  verifyPassword?: VerifyPassword;
  getUserFromToken?: GetUserFromToken;
  jwtCookieName?: string;
  permissions?: UserPermissionSetting;
};

class CollabServer {
  private server: ApolloServer;
  public generateId: () => Promise<string>;

  constructor(options: CollabServerOptions) {
    let { resolvers } = options;
    const {
      corsOption = {},
      idGenerator,
      logLevel,
      logTransports,
      emailOptions,
      customQueries,
      permissions,
      verifyPassword,
      getUserFromToken,
      jwtCookieName = 'wv-collab-token'
    } = options;
    // setup winston logging
    setupLogger(logLevel, logTransports);
    logger.info(`CollabServer version ${process.env.VERSION}`);

    validateParams('new CollabServer(options)', {
      'options.resolvers': [resolvers, 'object'],
      'options.resolvers.Query': [resolvers.Query, 'object'],
      'options.resolvers.Mutation': [resolvers.Mutation, 'object']
    });

    // setup custom query
    const schemasArr: any[] = [schema];
    const resolversArr = [makeResolvers()];
    resolvers = applyFormattersToResolvers(resolvers);
    if (customQueries) {
      schemasArr.push(customQueries.additionalTypeDefs);
      resolversArr.push(customQueries.additionalResolvers);
    }
    const mergedSchema = mergeSchemas({
      schemas: schemasArr,
      resolvers: resolversArr
    });

    const permSetting = setPermissions(permissions);
    const pubsub = new PubSub();
    const emailManager = new EmailManager(emailOptions);

    corsOption.credentials = true;

    const connectedUsers = new ConnectedUserMap();
    const subscriptionFields = {};

    this.server = new ApolloServer({
      schema: mergedSchema,
      subscriptions: {
        path: '/subscribe',
        onConnect: async (_, __, context) => {
          const token = retrieveToken(context.request.headers.cookie, jwtCookieName);
          let user;
          if (token) {
            if (getUserFromToken) {
              //@ts-ignore
              user = await getUserFromToken(token); //token provided by user
            } else {
              //@ts-ignore
              user = await getUser(token); //token generated by us
            }
          }
          if (user) {
            connectedUsers.connect(user.id);
            logger.info(`User ${user.id} connected`);
          } else {
            return false;
          }

          return {
            connectedUsers,
            wsUserId: user?.id
          };
        },
        onDisconnect: async (_, context) => {
          const p = await context.initPromise;
          if (p) {
            const { wsUserId } = p;
            leaveScrollSyncEvent(wsUserId, pubsub, connectedUsers);
            leaveConnectedDocUsersMap(wsUserId, pubsub, connectedUsers);
            connectedUsers.disconnectUser(wsUserId);
            if (wsUserId) {
              logger.info(`User ${wsUserId} disconnected`);
            }
          }
        }
      },
      cors: corsOption,
      engine: false,
      plugins: [
        {
          requestDidStart() {
            return {
              willSendResponse(context) {
                const ctx = context.context;
                if (ctx.stats) {
                  const requestData = ctx.stats.end();
                  logger.debug(requestData);
                }
              }
            };
          }
        }
      ],
      context: async ({ req, res, connection }) => {
        //context signature varies by integration
        const cookie = req?.headers.cookie || '';
        const token = retrieveToken(cookie, jwtCookieName);
        let user;
        if (token) {
          if (getUserFromToken) {
            if (verifyPassword) {
              logger.warn('Will not verify password, because getUserFromToken function is found.');
            }
            //@ts-ignore
            user = await getUserFromToken(token); //token provided by user
          } else {
            //@ts-ignore
            user = await getUser(token); //token generated by us
          }

          if (user) {
            connectedUsers.connect(user.id);
          }
        }
        const permissionSetting = {
          document: permSetting.document,
          annotation: permSetting.annotation
        };
        const cache = new ContextCache();

        const newResolvers = {
          Query: {},
          Mutation: {}
        };

        const stats = new RequestStats(req?.body?.operationName);

        const applyTransformsToResolvers = ({ applyTo, applyFrom, applyCache, type }) => {
          const clone = { ...applyFrom };
          const keys = Object.keys(clone);
          keys.reduce((acc, key) => {
            const oldFunc = clone[key];
            const newFunc = async (...args: string[]) => {
              type === 'Query' ? stats.totalQueryCount++ : stats.totalMutationCount++;
              let cacheKey = '';

              if (applyCache) {
                cacheKey = getCacheKey(key, ...args);
                const cachedResponse = cache.get(cacheKey);
                if (cachedResponse) {
                  stats.cachedResponseCount++;
                  return cachedResponse;
                }
              }

              stats.pushRequest({
                resolverName: key,
                params: args
              });
              let result;

              try {
                result = await oldFunc(...args);
              } catch (e) {
                const m = `An error occured in the '${type}.${key}' resolver - ${e.message}`;
                throwError(`${type}.${key}`, m);
              }

              if (applyCache) {
                cache.set(result, cacheKey);
              }

              stats.databaseResponseCount++;
              return result;
            };
            acc[key] = newFunc;
            return acc;
          }, applyTo);
        };

        applyTransformsToResolvers({
          applyTo: newResolvers.Query,
          applyFrom: resolvers.Query,
          applyCache: true,
          type: 'Query'
        });

        applyTransformsToResolvers({
          applyTo: newResolvers.Mutation,
          applyFrom: resolvers.Mutation,
          applyCache: false,
          type: 'Mutation'
        });

        if (connection) {
          subscriptionFields[connection.operationName] = getRequestedFields('' + connection.query);
        }
        const requestedFields = getRequestedFields(req?.body?.query);

        return {
          emailManager,
          emailOptions,
          res,
          user,
          permissionSetting,
          pubsub,
          verifyPassword,
          getUserFromToken,
          jwtCookieName,
          cache,
          resolvers: newResolvers,
          stats,
          token,
          connectedUsers,
          requestedFields,
          subscriptionFields
        } as Context;
      }
    });
    this.generateId = generateId;
    idGenerator && setGenerator(idGenerator);
  }
  static LogLevels = LogLevels;
  static sendGridEmailHandler = sendGridEmailHandler;
  static Permissions = Permissions;

  start(port = 8080) {
    validateParams('start(port)', {
      port: [port, 'number', false]
    });
    // The `listen` method launches a web server.
    return this.server.listen(port).then(({ url, subscriptionsUrl }) => {
      logger.info(
        `🚀 Query server ready at ${url}. Enter this URL for the 'url' property in the client constructor`
      );
      logger.info(
        `🚀 Subscription server ready at ${subscriptionsUrl}. Enter this URL for the 'subscriptionUrl' property in the client constructor`
      );
    });
  }

  stop() {
    return this.server.stop();
  }
}

export default CollabServer;

/**
 * @ignore
 * Applies a layer of formatting in front of all user resolvers
 * Right now just changes all timestamps
 */
export const applyFormattersToResolvers = (resolvers: UserResolvers): UserResolvers => {
  const { Mutation } = resolvers;
  const keys = Object.keys(Mutation);
  keys.forEach((key) => {
    const baseFunc = Mutation[key];
    const newFunc = (...args) => {
      setTime();
      const newArgs = args.map((arg) => setTimestamps(arg));
      const result = baseFunc(...newArgs);
      clearTime();
      return result;
    };
    resolvers.Mutation[key] = newFunc;
  });
  return resolvers;
};

